static inline float lanczos_3(float x) {
    return _lanczos_3[(int)(x * 1024.0) + 4096];
}

template<typename T>
inline T clamp(const T &a, const T &b, const T &c) {
    if (a < b) { return b; }
    if (a > c) { return c; }
    return a;
}

void computeWeights(int oldSize, int newSize, vector<vector<pair<int, float> > > &matrix) {

    float filterWidth = max(1.0f, (float)oldSize / newSize);

    matrix.resize(newSize);

    for (int x = 0; x < newSize; ++x) {
        // This x in the output corresponds to which x in the input?
        float inX = (x + 0.5) / newSize * oldSize - 0.5;

        // Now compute a filter surrounding said x in the input
        int minX = ceilf(inX - filterWidth*3);
        int maxX = floorf(inX + filterWidth*3);
        minX = clamp(minX, 0, oldSize-1);
        maxX = clamp(maxX, 0, oldSize-1);

        // Compute a row of the sparse matrix
        matrix[x].resize(maxX - minX + 1);
        float totalWeight = 0;
        for (int i = minX; i <= maxX; ++i) {
            float delta = i - inX;
            float w = lanczos_3(delta/filterWidth);
            matrix[x][i - minX] = make_pair(i, w);
            totalWeight += w;
        }
        for (int i = 0; i <= maxX - minX; ++i) {
            matrix[x][i].second /= totalWeight;
        }
    }
}

Grid *resampleY(Grid *grid, int width, int varnum) {
    vector<vector<pair<int, float> > > matrix;
    computeWeights(grid->width, width, matrix);

    Grid *out = new Grid(grid->length, width, grid->height, varnum);

    for (int v = 0; v < varnum; ++v) {
        for (int z = 0; z < out->height; ++z) {
            for (int y = 0; y < out->width; ++y) {
                for (int x = 0; x < out->length; ++x) {
                    float val = 0;
                    for (size_t i = 0; i < matrix[y].size(); ++i) {
                        val += matrix[y][i].second * (*grid)(x, matrix[y][i].first, z, v);
                    }
                    (*out)(x, y, z, v) = val;
                }
            }
        }
    }

    return out;
}

Grid *resampleX(Grid *grid, int length, int varnum) {
    vector<vector<pair<int, float> > > matrix;
    computeWeights(grid->length, length, matrix);

    Grid *out = new Grid(length, grid->width, grid->height, varnum);

    for (int v = 0; v < varnum; ++v) {
        for (int z = 0; z < out->height; ++z) {
            for (int y = 0; y < out->width; ++y) {
                for (int x = 0; x < out->length; ++x) {
                    float val = 0;
                    for (size_t i = 0; i < matrix[x].size(); ++i) {
                        val += matrix[x][i].second * (*grid)(matrix[x][i].first, y, z, v);
                    }
                    (*out)(x, y, z, v) = val;
                }
            }
        }
    }

    return out;
}

